result:
    .product_info{
        display: flex;
        flex-direction: column;
        height: 100vh;
        .head{
            background: #fff;
            .tab-box{
                display: flex;
                align-items: center;
                justify-content: space-between;
                height: .8rem;
                padding: 0 1.46rem;
                .tab-item{
                    height: .8rem;
                    line-height: .8rem;
                    padding: 0 .15rem;
                    font-size: .28rem;
                    color: #282828;
                    &.on{
                        border-bottom: 1px solid #3875EA;
                    }
                }
            }
            .search-box{
                display: flex;
                align-items: center;
                height: 1.28rem;
                padding: 0 .3rem;
                input{
                    display: block;
                    width: 100%;
                    height: .68rem;
                    padding-left: .7rem;
                    background: #F5F6F9;
                    border-radius: .39rem;
                    box-sizing: border-box;
                    /*background-image: url("../static/search.png");*/
                }
            }
        }
        .scroll-box{
            flex: 1;
            overflow: hidden;
            .goods-item{
                display: flex;
                padding: .3rem;
                margin-top: .15rem;
                background-color: #fff;
                img{
                    width: 1.7rem;
                    height: 1.7rem;
                    border-radius: 0.06rem;
                }
                .info{
                    width: 3.26rem;
                    margin-left: .22rem;
                    .title{
                        font-size: .28rem;
                        color: #282828;
                    }
                    .num{
                        margin-top: .1rem;
                        font-size: .24rem;
                        color: #9F9F9F;
                    }
                }
                .right{
                    flex: 1;
                    display: flex;
                    flex-direction: column;
                    justify-content: space-between;
                    margin-left: .36rem;
										padding-right: 1.1rem;
                    .price{
                        color: #F74C31;
                    }
                    .btn{
                        width: 100%;
                        height: .6rem;
                        line-height: .6rem;
                        text-align: center;
                        color: #fff;
                        background: #3875EA;
                        border-radius: 0.06rem;
                    }
                }
            }
        }
    }
